%angular 
<link rel="stylesheet" href="https://unpkg.com/leaflet@1.0.3/dist/leaflet.css" />
<div id="map" style="height: 800px; width: 100%"> </div>
<script type="text/javascript">
function initMap() {
    var map = L.map('map').setView([37.577001, 127.018902], 6);
    L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
        attribution: 'Map data © <a href="http://openstreetmap.org">OpenStreetMap</a> contributors',
        maxZoom: 20,
        minZoom: 13
    }).addTo(map);
    var geoMarkers = L.layerGroup().addTo(map);
    var lat = 37.574241;
    var long = 127.015142;
    var lat1 = 37.5744464;
    var long1 = 127.015142;
    var LJIcon = L.icon({
    iconUrl: 'http://www.clker.com/cliparts/p/6/e/f/A/e/blue-marker-black-border-md.png',
    iconSize: [20, 30]
    });
   var marker = L.marker([ lat,long ],{icon: LJIcon} ).bindPopup("Road_address" +" : " + "Seouljongno jibong5load 5").addTo(map);
   var marker1 = L.marker([ lat1, long1 ],{icon: LJIcon} ).bindPopup("Road_address" +" : " + "Seouljongno changsin4stload").addTo(geoMarkers)

}
if (window.L) {
    initMap();
} else {
    console.log('Loading Leaflet library');
    var sc = document.createElement('script');
    sc.type = 'text/javascript';
    sc.src = 'https://unpkg.com/leaflet@1.0.3/dist/leaflet.js';
    sc.onload = initMap;
    sc.onerror = function(err) { alert(err); }
    document.getElementsByTagName('head')[0].appendChild(sc);
}
</script>
